using namespace std;
typedef long long ll;


int getint() { int x; scanf("%d", &x); return x; }
#define P 100000
int pr[P], npr;
bool is_pr[P+1];
int sieve() {
    int i, j, d;
    for (i = 3; i <= P; i += 2) is_pr[i] = 1; is_pr[2] = 1;
    for (i = 3; i * i <= P; i += 2) if (is_pr[i]) {
        for (j = i * i, d = i << 1; j <= P; j += d) is_pr[j] = 0;
    }
    for (i = 2; i <= P; i++) if (is_pr[i]) pr[npr++] = i;
    return npr;
}

const int B = 92;
int c2i(int c) { if (c >= 92) c--; if (c >= 34) c--; c -= 33; return c; }
ll decode(string s) { ll res = 0, t = 1; for (int i = 0; i < s.size(); i++) res += t * c2i(s[i]), t *= B; return res; }

