vector<string> split_string(string str, string delim = "") {
    vector<string> res;
    for (int i = 0; i < (int)str.size(); i++) if (delim.find(str[i]) != string::npos) str[i] = ' ';
    stringstream ss(str);
    while (ss >> str) res.push_back(str);
    return res;
}

